style.css:
/* Change background color */
body {
    background-color: #A020F0;
}

/* Change font and text color */
p {
    font-family: Arial, sans-serif;
    color: #333;
}

/* Style links */
a {
    color: #1e90ff;
    text-decoration: none;
}
a:hover {
    text-decoration: underline;
}

/* Modify header styles */
h1 {
    color: #ff4500;
    font-size: 2.5em;
}

h2 {
    color: #ff6347;
    font-size: 2em;
}
